import React from "react";
import { PowerBIEmbed } from "powerbi-client-react";

const PowerBI = () => {
  return (
    <div>
      <PowerBIEmbed
        embedConfig={{
          type: "report",
          id:'<Report Id>',
          embedUrl:'<Embed Url>',
          accessToken: '<Access Token>',
          tokenType: models.tokenType
        }}
      ></PowerBIEmbed>
    </div>
  );
};

export default PowerBI;
